import React from 'react';
import { Link } from 'react-router-dom';


const Nav = () => {
  return (
    <nav>
      <Link to="/home">Home</Link>
      <Link to="/about">About</Link>
      <Link to="/projects">Projects</Link>
    </nav>
  );
}

export default Nav;
